import React from "react";

import "./ImageContainer.css";

const ImageContainer = (props) => {
    return (
        <div className="col-lg-6 col-sm-12 ">
            <img src={props.src} alt="Denis Ladychenko"/>
        </div>
    );
};


export default ImageContainer;
